import React from "react";

function AIAgents() {
    return (
        <section id="ai-agents" className="section animated zoomIn">
            <h2>AI Agents</h2>
            <p>
                Our flagship AI Agents product combines traditional counselor expertise with state-of-the-art
                AI, providing personalized and comprehensive guidance through every step of the college
                application process.
            </p>
        </section>
    );
}

export default AIAgents;
